import React from 'react';

const Show = () =>{
    const Mdikhao =() =>{
        document.querySelector('.Movie').style.display = 'none';
    }
    
    return (
        <button onClick = {Mdikhao}>Web</button>
    );
};

const Navbar = (props) => {
    
    return (
        <>
        <div className = {`container ${props.btao}`}>
            <div className = "images">
                <img src = {props.images}/>
            </div>
            <div className = "sec">
            <div className = "about">
                <h3> {props.title}</h3>
                <p> {props.btao} </p>
                <p> {props.date}</p>
            </div>
            <div className = "buttons">
                <button> Watch Now</button>
                <button> Add to Wishlist</button>
            </div>
            </div>
        </div>
        </>
    )
}

export default Navbar;
export {Show};
